package lpf.learn.leetcode.tags.dp;

import org.junit.Assert;
import org.junit.Test;

public class CountNumberOfTextsTest {
    @Test
    public void test1(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(20736, test.countTexts("55555555999977779555"));
    }

    @Test
    public void test2(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(8, test.countTexts("22233"));
    }

    @Test
    public void test3(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(82876089, test.countTexts("222222222222222222222222222222222222"));
    }

    @Test
    public void test4(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(928, test.countTexts("355577777788899"));
    }

    @Test
    public void test5(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(537551452, test.countTexts("444444444444444444444444444444448888888888888888999999999999333333333333333366666666666666662222222222222222666666666666666633333333333333338888888888888888222222222222222244444444444444448888888888888222222222222222288888888888889999999999999999333333333444444664"));
    }

    @Test
    public void test6(){
        CountNumberOfTexts test = new CountNumberOfTexts();
        Assert.assertEquals(886136986, test.countTexts(""));
    }
}
